import React from "react";
import "./Footer.css";
import { Button } from "./Button";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <div>
      <section
        id="contact"
        className="contact"
        style={
          { background: "#333" },
          { color: "white" },
          { textAlign: "justify" },
          { padding: "1em" }
        }
      >
        <div className="section-title">
          <h2 style={{ color: "white" }, { fontSize: "3.5 em" }}>Contact</h2>
          <p
            style={{ color: "white" }, { fontSize: "1.7em" }}
            className="d-block w-75"
          >
            For any business enquiries get in touch with me through my address
            and email-id
          </p>
        </div>

        <div className="address">
          <i className="icofont-google-map" style={{ fontSize: "1.5em" }}></i>
          <h4 id="loc">Location: Pune, MH, IN</h4>
        </div>
        <br />
        <div className="email">
          <i className="icofont-envelope" style={{ fontSize: "1.5em" }}></i>
          <h4 id="ml">Email: devang.manjramkar20@gmail.com</h4>
        </div>

        <iframe
          title="location"
          src="https://maps.google.com/maps?q=Pune&t=&z=11&ie=UTF8&iwloc=&output=embed"
          frameborder="0"
          style={
            { border: "0" },
            { width: "100%" },
            { height: "290px" },
            { borderRadius: "30px" }
          }
          allowfullscreen
        ></iframe>
      </section>
    </div>
  );
}

export default Footer;
